script: |
  super -f text -I q3210.spq | sort > q3210.out

inputs:
  - name: q3210.spq
    data: |
      SELECT DISTINCT - 65 * - col0 AS col2, 61, + 3 AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q3210.out
    data: |
      3315	61	3
      5525	61	3
      5915	61	3
